import React, {Component} from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';

class MyMessage extends Component {
    constructor(props){
        super(props);
        this.state={
            mymessages: [],
            update_form: "none",
            visible: "hidden"
        };
    }
    render(){
        const myPostList={
            visibility: this.state.visible
        }
        return(
            <div>
                <div style={myPostList}>
                    <Table>
                    <TableHead>
                    <TableRow>
                    <TableCell>쪽지번호</TableCell>
                    <TableCell>보낸이</TableCell>
                    <TableCell>생성일</TableCell>
                    <TableCell>수정일</TableCell>
                    <TableCell>내용</TableCell>
                    <TableCell></TableCell>
                    <TableCell></TableCell>
                    </TableRow>
                    </TableHead>
                    <TableBody>
                        {/* {this.state.mymessages.map((message) => {
                        return <MyMessageItems key={message.id} id={message.id} nickname={message.member.nickname} createDate={message.createdAt} updateDate={message.updatedAt} message={message.message} 
                                superDelete={this.delete_post} superUpdate={this.update_post} entries={this.state.myposts} showPosts={this.ShowPosts}/>
                        })}
                        {this.checkMyPost} */}
                    </TableBody>
                    </Table>
                </div>
            </div>
        );
    }
}

export default MyMessage;
